import './QuizQuestion.css';

const QuizQuestion = () => {
	return (
		<div>
			<h1 className='qtn'>
				In order to set the width and height of an element correctly in all
				browsers, you need to know how the box model works.
			</h1>
		</div>
	);
};

export default QuizQuestion;
